import React, { useState } from 'react';
import Loading from './Loading';
import NothingToShow from './NothingToShow';
import { Link } from 'react-router-dom';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import useStyles from "./styles";


const ListOfMathcingResults = () => {
  const classes = useStyles();
  //const { episodes, loading, error } = useContext(GlobalContext);
  const { artistsList, setAtirtistsList} = useState([{name: 'some name'}])
  const { error, setError} = useState([{}])
  const { loading, setLoading} = useState([{}])

  if (error) {
    return <Typography variant="p" color="inherit">Error! Failed to loadÂ episodes!</Typography>
  }

  return (
    <div>
      {loading ? (
        <Loading />
      ) : (
          <div>

            { [{name: 'some name'}].length === 0 || artistsList ?
              <NothingToShow />
              :
              <List className={classes.root}>
                {
                  artistsList.map((item) => (

                    <ListItem
                      className={classes.listItem}
                      key={item.id}
                      alignItems="center"
                      divider
                      button
                      component={Link}
                      to={`/artist/${item.name}`}
                    >

                      <img src={item.picture} alt="img" />
                      <ListItemText primary={`${item.name}`} />
                      <ListItemText primary={`Fans count: ${item.nb_fan}`} />
                      <Button
                        variant="outlined"
                        color="primary"
                      >
                        more
                        </Button>

                    </ListItem>
                  ))
                }
              </List>
            }
          </div>
        )}
    </div>
  );
};

export default ListOfMathcingResults;
